import React from "react";
import DoubleSideCard from "../Components/DoubleSideCard";
import HeroSection from "../Components/HeroSection";
import launchpic from "../Images/launchpic.jpg";
import rockets from "../Images/rockets.jpg";
import starlinks from "../Images/starlink.jpg";

export default function HomePage() {
  return (
    <div>
      <HeroSection />
      <DoubleSideCard
        dir={1}
        title="Starlink"
        subtitle="With high speeds and latency as low as 20ms in most locations, Starlink enables video calls, online gaming, streaming, and other high data rate activities that historically have not been possible with satellite internet. Users also have the option to take Starlink with them via the Portability feature or Starlink for RVs service."
        desc="Starlink is on the leading edge of on-orbit debris mitigation, meeting or exceeding all regulatory and industry standards. At end of life, the satellites will utilize their on-board propulsion system to deorbit over the course of a few months.

        "
        cardimg={starlinks}
        buttonLink="/starlink"
      />
      <DoubleSideCard
        dir={2}
        title="Launches"
        subtitle="Some Info"
        desc="Some Desc"
        cardimg={launchpic}
        buttonLink="/starlink"
      />
      <DoubleSideCard
        dir={1}
        title="Rockets"
        subtitle="Some Info"
        desc="Some Desc"
        cardimg={rockets}
        buttonLink="/starlink"
      />
    </div>
  );
}
